import React from 'react'
import { View,Text } from 'react-native'

export const ResultList = ({title}) => {
    return (
        <View>
            <Text>{title}</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    title:{
        fontSize:18,
        fontWeight:'bold'
    }
})
